import {React, useState} from 'react';
import '../styles/CardStyles.css';

const AtakStatus = ({ atak }) => {
    return (
    <div className="card">
        <h2>ATAK Status</h2>
        <p>Connected: {atak.connected ? 'Yes' : 'No'}</p>
    </div>
    )
}

export default AtakStatus;
